// SignInPage.js
import React, { useState } from 'react';
import './SignInPage.css'; // Create a CSS file for styling if needed

function SignInPage() {
  const [fullName, setFullName] = useState('');
  const [mobile, setMobile] = useState('');
  const [email, setEmail] = useState('');
  const [newPassword, setNewPassword] = useState('');
  const [validationErrors, setValidationErrors] = useState({
    fullName: '',
    mobile: '',
    email: '',
    newPassword: '',
  });

  const handleSignUp = () => {
    // Perform SignUp logic here, such as sending data to the server
    if (validateInputs()) {
      console.log('SignUp Data:', { fullName, mobile, email, newPassword });
      // You can add further logic for API calls, etc.
    } else {
      console.log('Validation failed. Please check the input values.');
    }
  };

  const validateInputs = () => {
    const fullNameRegex = /^[a-zA-Z\s]+$/;
    const mobileRegex = /^\d+$/;
    const emailRegex = /^[a-zA-Z0-9._-]+@gmail\.com$/;
    const passwordRegex = /^(?=.*[A-Z])(?=.*[0-9])(?=.*[!@#$%^&*()_+])[a-zA-Z0-9!@#$%^&*()_+]{5,}$/;

    let isValid = true;

    // Validate Full Name
    if (!fullNameRegex.test(fullName)) {
      setValidationErrors((prevErrors) => ({
        ...prevErrors,
        fullName: 'Please enter only alphabets.',
      }));
      isValid = false;
    } else {
      setValidationErrors((prevErrors) => ({ ...prevErrors, fullName: '' }));
    }

    // Validate Mobile
    if (!mobileRegex.test(mobile)) {
      setValidationErrors((prevErrors) => ({
        ...prevErrors,
        mobile: 'Please enter only numbers.',
      }));
      isValid = false;
    } else {
      setValidationErrors((prevErrors) => ({ ...prevErrors, mobile: '' }));
    }

    // Validate Email
    if (!emailRegex.test(email)) {
      setValidationErrors((prevErrors) => ({
        ...prevErrors,
        email: 'Please enter a valid Gmail address.',
      }));
      isValid = false;
    } else {
      setValidationErrors((prevErrors) => ({ ...prevErrors, email: '' }));
    }

    // Validate Password
    if (!passwordRegex.test(newPassword)) {
      setValidationErrors((prevErrors) => ({
        ...prevErrors,
        newPassword:
          'Password should contain at least one capital letter, one special character, one number, and have a minimum length of 5.',
      }));
      isValid = false;
    } else {
      setValidationErrors((prevErrors) => ({ ...prevErrors, newPassword: '' }));
    }

    return isValid;
  };

  return (
    <div className='signin-container'>
      <h2>Sign Up</h2>
      <form className='signin-form'>
        <div className='form-group'>
          <table className='label-input-table'>
            <tbody>
              <tr>
                <td><label>Full Name:</label></td>
                <td>
                  <input
                    type='text'
                    className='form-control'
                    value={fullName}
                    onChange={(e) => setFullName(e.target.value)}
                  />
                  <p className='error-message'>{validationErrors.fullName}</p>
                </td>
              </tr>
            </tbody>
          </table>
        </div>

        <div className='form-group'>
          <table className='label-input-table'>
            <tbody>
              <tr>
                <td><label>Mobile:</label></td>
                <td>
                  <input
                    type='text'
                    className='form-control'
                    value={mobile}
                    onChange={(e) => setMobile(e.target.value)}
                  />
                  <p className='error-message'>{validationErrors.mobile}</p>
                </td>
              </tr>
            </tbody>
          </table>
        </div>

        <div className='form-group'>
          <table className='label-input-table'>
            <tbody>
              <tr>
                <td><label>Email:</label></td>
                <td>
                  <input
                    type='email'
                    className='form-control'
                    value={email}
                    onChange={(e) => setEmail(e.target.value)}
                  />
                  <p className='error-message'>{validationErrors.email}</p>
                </td>
              </tr>
            </tbody>
          </table>
        </div>

        <div className='form-group'>
          <table className='label-input-table'>
            <tbody>
              <tr>
                <td><label>New Password:</label></td>
                <td>
                  <input
                    type='password'
                    className='form-control'
                    value={newPassword}
                    onChange={(e) => setNewPassword(e.target.value)}
                  />
                  <p className='error-message'>{validationErrors.newPassword}</p>
                </td>
              </tr>
            </tbody>
          </table>
        </div>

        <button type='button' className='btn btn-success' onClick={handleSignUp}>
          Sign Up
        </button>
      </form>
    </div>
  );
}

export default SignInPage;
